import React from 'react';
import './teaching.css'; 

class Teaching extends React.Component{
    render(){
        return(
            <div>
                <h1>Classes</h1>
                <br />
                <hr />
                <h2>Fall 2018</h2>
                
            </div>
        )
    }
}

export default Teaching;
